/* Reset for consistency */
* { margin: 0; padding: 0; box-sizing: border-box; }
body { 
    font-family: 'Arial', sans-serif; 
    font-size: 16px; 
    line-height: 1.6;
    padding: 20px;
    max-width: 700px;
}

/* Typography */
h3 {
    font-size: 20px;
    margin-bottom: 12px;
    font-weight: bold;
}

p {
    margin-bottom: 16px;
}

/* Definition list styles */
dl {
    margin: 16px 0;
}

dt {
    font-weight: bold;
    margin-top: 16px;
    margin-bottom: 4px;
}

dt:first-child {
    margin-top: 0;
}

dd {
    margin-left: 24px;
    margin-bottom: 8px;
    color: #555;
}

/* Code in definitions */
code {
    font-family: 'Courier New', monospace;
    font-size: 14px;
    background-color: #f3f4f6;
    padding: 2px 4px;
    border-radius: 3px;
}
